	  212163,"1",4472,31,1992,
	  "2.25 USD; 2.70 CAD",36.000,"monthly","The original printing of this book was sold in a polybag with one of two scratch and sniff \"Air Foulers\" of either Ren or Stimpy. The second and third printings of the book were not bagged had no \"Air Foulers\" and have a cover price of 1.75 USD and 2.25 CAD.  The cover text changed for the later printings but the interior stayed the same. The cover text of the second printing reads \"Eediot! Eet's a second preenting! Eet's worthless!!\". The cover text of the third printing reads \"Eediot! It's a third printing -- It's worthless!!\" Special thanks to John Hedegor for providing the information on the first and second printings. ",
	  NULL,NULL,NULL,NULL,NULL,"Approved by the Comics Code Authority"
