	  212437,"1",7533,243,1982,
	  "2.95 USD; 3.50 CAD",68.000,NULL,"This issue has four separate printings.  All printings subsequent to the first one list \"Fall 1982\" rather than \"September 1982\" in the indicia which is another way to verify that an issue isn't a first print for those who aren't sure what the various cover prices for the various printings were. 1st printing- (July 1982)- 2.95 cover price.2nd printing (October 1987)-  $3.50 cover price. This is the only one that marks itself boldly as a second printing in traditional comic book indicia style and does so immediately after the Fall '82 cover date.  3rd printing (February 1992)- $3.95 cover price. 5th printing (May 1995)- $4.95 cover price. This is actually the fourth printing but states otherwise apparently due to a misprint. The information regarding the exact printing and release date is found towards the end of the indicia in these subsequent printings.",
	  NULL,NULL,NULL,NULL,NULL,NULL
