	  );INSERT INTO issue(id, number, series_id, indicia_publisher_id, publication_date, price, page_count, indicia_frequency, notes, isbn, valid_isbn, barcode,title, on_sale_date, rating) VALUES(
	  212923,"1",79840,85,1956,
	  "0.10 USD",36.000,NULL,"This issue marks the first appearance of Little Archie. In his interview with Gary Brown in Comic Book Artist (March 2004) Little Archie's creator Bob Bolling recalled that editor Harry Shorten called him in and said \"I want you to do a book of Archie as a little boy but before you do I want you to do some sketches and I'm going to mail them to [publisher] John Goldwater.\" Bolling designed the Archie characters as children and once they were approved by Shorten and Goldwater he wrote and drew the entire first issue.Bob Bolling told Gary Brown that Bob White inked most of this issue.",
	  NULL,NULL,NULL,NULL,NULL,NULL
	  );INSERT INTO issue(id, number, series_id, indicia_publisher_id, publication_date, price, page_count, indicia_frequency, notes, isbn, valid_isbn, barcode,title, on_sale_date, rating) VALUES(
