	  213128,"11",10120,2,2003,
	  "49.95 USD; 82.95 CAD",212.000,NULL,"Most credits from the notes of Cat Yronwode (printed in Kitchen Sink's Spirit Magazines) and Lou Mougin.  According to Martin O'Hearn who has access to Bill Woolfolk's records. http://martinohearn.blogspot.com/ Woolfolk's last Spirit script was written in October 1944. Therefore it is very unlikely there are any Woolfolk scripts in this volume.Don Komisarow and Lou Fine formed an art studio together and went into the commerical art business around this time.  Therefore Fine stopped relying on Quality to get his stories inked and relied on the much more consistent Komisarow.",
