	  214521,"21",1968,NULL,1974,
	  "0.75 USD",68.000,NULL,"Cover states this is the 1974 Nightmare Summer-Special. Only the titlepage states that this is #21. All data by Richard Arndt used with his permission.",
	  NULL,NULL,NULL,NULL,NULL,NULL
	  );INSERT INTO issue(id, number, series_id, indicia_publisher_id, publication_date, price, page_count, indicia_frequency, notes, isbn, valid_isbn, barcode,title, on_sale_date, rating) VALUES(
	  214522,"22",1968,NULL,1974,
	  "0.75 USD",68.000,NULL,"In 1974 Skywald had planned a new magazine — Tomb Of Horror — but it was decided that the stands were too crowded to launch a new book at the time so the contents were repackaged as this issue which was billed as the ‘Tomb Of Horror’ Special Edition.  However Hewetson makes it clear to the readers that this is a ‘pilot’ issue meaning that if the demand was there Tomb Of Horror could still see the light of day.  The question was rendered moot as the entire Skywald line folded with a couple of months. Tomb Of Horror’s kick was to have the authors and artists introduce the stories instead of the usual EC/Warren/Web Of Horror type horror hosts. Misdated October 1974 probably because this was originally supposed to be Nightmare #21.",
	  NULL,NULL,NULL,NULL,NULL,NULL
	  );INSERT INTO issue(id, number, series_id, indicia_publisher_id, publication_date, price, page_count, indicia_frequency, notes, isbn, valid_isbn, barcode,title, on_sale_date, rating) VALUES(
